export async function createNewCognitoUser(UserData: CognitoUserData, props: CognitoDataSeedingProps): Promise<void> {
 if (userData.password) {
 await Client.send(new AdminSetUserPasswordCommand({
 UserPoolId: props.userPoolId,
 Username: userInfo.User.Username,
 Password: userData.password,
 Permanent: true,
 }));
 log.debug('Cognito Data Seeding] Set password for user: ${userData.username}');
 }

 // Set groups if required
 if (userData.groups) {
 await Promise.all(userData.groups.map(groupName => {
 Client.send(new AdminAddUserToGroupCommand({
 UserPoolId: props.userPoolId,
 Username: userInfo.User.Username,
 GroupName: groupName,
 }));
 log.debug('Cognito Data Seeding] Set groups for user: ${userData.username}');
 }

