export async function updateExistingCognitoUser(userData: CognitoUserData, props: CognitoDataSeedingProps, ...)

// Debug: log('Cognito Data Seeding] Updated user attributes...)

if (props.removeAttributesOnUpdate) {
 const attributesToRemove: string[] = [];
 userData.Attributes
 .filter(it: AttributeType => it.Name !== 'sub') // system attribute, we should not remove it
 .forEach((attr: AttributeType) => {
 if (attr.ExpectedAttributeType?.find((AttributeType => attr.Name === it.Name)) !== null) {
 attributesToRemove.push(attr.Name);
 }
 });

 if (attributesToRemove.length > 0) {
 await client.send(new AdminDeleteUserAttributesCommand({
 UserPoolId: props.userPoolId,
 Username: userData.UserInfo.Username,
 UserAttributes: attributesToRemove.map((AttributeType => it.Name)).join(', ')
 }).promise();
 log.debug('Cognito Data Seeding] Removed...);
 }

 if (userData.password && props.updatePasswordOnUpdate) {
 await client.adminSetUserPassword({
 UserPoolId: props.userPoolId,
 Username: userData.UserInfo.Username,
 Password: props.newPassword,
 Permanent: true
 }).promise();
 }

 log.debug('Cognito Data Seeding] Password updated for user: ${userData.UserInfo.Username}');
